import React, { Component } from 'react';
import { Nav } from 'react-bootstrap';

class CatagoryMenu extends Component {


	render() {
		return (
			<Nav defaultActiveKey="/home" as="ul">
				<Nav.Item as="li">
					<Nav.Link href="/home">Clothing</Nav.Link>
				</Nav.Item>
				<Nav.Item as="li">
					<Nav.Link eventKey="link-1">Sportwear</Nav.Link>
				</Nav.Item>
				<Nav.Item as="li">
					<Nav.Link eventKey="link-2">Outwear</Nav.Link>
				</Nav.Item>
				<Nav.Item as="li">
					<Nav.Link eventKey="link-2">Bags</Nav.Link>
				</Nav.Item>
				<Nav.Item as="li">
					<Nav.Link eventKey="link-2">Shose</Nav.Link>
				</Nav.Item>
				<Nav.Item as="li">
					<Nav.Link eventKey="link-2">Beauty</Nav.Link>
				</Nav.Item>
				<Nav.Item as="li">
					<Nav.Link eventKey="link-2">Accessories</Nav.Link>
				</Nav.Item>
			</Nav>
		);
	}
}

export default CatagoryMenu;
